import { Route, Switch } from 'react-router-dom';

import AllQuates from './pages/AllQuates';
import QuateDetail from './pages/QuateDetail';
import NewQuate from './pages/NewQuate';

function App() {
  return (
    <div>
      <Switch>
        <Route path='/quates' >
          <AllQuates />
        </Route>
        <Route path='/quates/:quiteId'>
          <QuateDetail />
        </Route>
        <Route path='/new-quate'>
          <NewQuate />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
